import React from 'react';

const Footer = () => {
  return (
    <div style={{ paddingBottom: '80px', fontFamily: 'Quicksand' }}> {/* Added fontFamily */}
      <footer style={{ backgroundColor: 'rgba(0, 0, 0, 0.1)', color: '#fff', paddingTop: '50px' }}> {/* Changed backgroundColor */}
        <h2 style={{ marginLeft: '20px', color: '#AB91F1' }}>Tiny <span style={{ color: 'black' }}>Treasure</span></h2> {/* Added fontFamily */}
        <div style={{ display: 'flex', justifyContent: 'space-between', maxWidth: '1200px', margin: '0 auto' }}>
          <div style={{ flex: 1 }}>
            <h3 style={{ color:'#000' }}>CUSTOMER</h3> {/* Removed fontFamily */}
            <ul style={{ listStyle: 'none', padding: 0 }}>
              <li><a href="#" style={{ color: '#000', textDecoration: 'none' }}>Contact Us</a></li>
              <li><a href="#" style={{ color: '#000', textDecoration: 'none' }}>Track Order</a></li>
              <li><a href="#" style={{ color: '#000', textDecoration: 'none' }}>Return Order</a></li>
              <li><a href="#" style={{ color: '#000', textDecoration: 'none' }}>Cancel Order</a></li>
            </ul>
          </div>
          {/* Remaining code */}
        </div>
        <div style={{ display: 'flex', justifyContent: 'flex-start', padding: '20px 0 0 20px' }}>
          <button style={{ backgroundColor: 'black', color: 'white', padding: '10px 20px', marginRight: '10px' }}>Google Play</button>
          <button style={{ backgroundColor: 'black', color: 'white', padding: '10px 20px' }}>Apple Store</button>
        </div>
      </footer>
    </div>
  );
}

export default Footer;
